import {
    GET_PIPELINE_DATA,
    GET_UPDATEPLAN_DATA

} from '../Actions/Types';

const initialState = {
    pipelineData: [],
    updatePlan: [],
    loading: false

}

export default function (state = initialState, action) {
    switch (action.type) {

        case GET_PIPELINE_DATA: return {
            ...state,
            pipelineData: action.payload
        };
        case GET_UPDATEPLAN_DATA: return {
            ...state,
            updatePlan: action.payload
        };


        default: return state;
    }
}
